import React from 'react';
import { NavLink } from 'react-router-dom'

import { Menu } from 'antd';
import Header from './components/Header';
import './App.css';

function App() {
  return (
    <div>
      <Header></Header>
      <Menu
        style={{
          width: 256,
        }}
        mode="inline"
      >
        <Menu.Item>
          <NavLink className='list-group-item' to='/jobManagemen'>作业管理</NavLink>
        </Menu.Item>
        <Menu.Item>
          <NavLink className='list-group-item' end to='/explorationProject'>勘探项目</NavLink>
        </Menu.Item>
      </Menu>

    </div>
  );
}

export default App;
